etryCount = 0; data.buffer[0] = 1; // Buffer type memcpy(data.buffer + 1, gpioBuffer, BUFFER_SIZE - 1); sendBufferToSlave(data); } if (i2cBufferHasData()) { EspNowData data; data.retryCount = 0; data.buffer[0] = 2; // Buffer type memcpy(data.buffer + 1, i2cBuffer, BUFFER_SIZE - 1); sendBufferToSlave(data); } if (spiBufferHasData()) { EspNowData data; data.retryCount = 0; data.buffer[0] = 3; // Buffer type memcpy(data.buffer + 1, spiBuffer, BUFFER_SIZE - 1); sendBufferToSlave(data); } delay(1000); } // Callback function for handling I2C interrupt void IRAM_ATTR i2cInterruptHandler() { // Add your I2C interrupt code here } // Callback function for handling SPI interrupt void IRAM_ATTR spiInterruptHandler() { // Add your SPI interrupt code here } // GPIO Interrupt handlers void IRAM_ATTR gpioInterrupt1() { // Read the state of GPIO pin 1 and update the gpioBuffer accordingly gpioBuffer[0] = digitalRead(GPIO_PIN1); gpioBuffer[1] = 0; // Placeholder for any other GPIO pin(s) } void IRAM_ATTR gpioInterrupt2() { // Read the state of GPIO pin 2 and update the gpioBuffer accordingly gpioBuffer[1] = digitalRead(GPIO_PIN2); gpioBuffer[0] = 0; // Placeholder for any other GPIO pin(s) } // Check if there is any data in the GPIO buffer bool gpioBufferHasData() { for (int i = 0; i < 2; i++) { if (gpioBuffer[i] != 0) { return true; } } return false; } // Check if there is any data in the I2C buffer bool i2cBufferHasData() { // Check the corresponding condition for I2C buffer data presence // For example, if using an I2C sensor and i2cBuffer as output // Return true if i2cBuffer[0] != 0; return false; } // Check if there is any data in the SPI buffer bool spiBufferHasData() { // Check the corresponding condition for SPI buffer data presence // For example, if using SPI module and spiBuffer as output // Return true if spiBuffer[0] != 0; return false; } // Function to send data over ESP-NOW void sendData(const uint8_t* macAddress, const uint8_t* buffer, size_t size) { esp_err_t result